import { Component, ViewChild } from '@angular/core';
import ApexCharts from 'apexcharts';

import {
  ApexAxisChartSeries,
  ApexChart,
  ApexDataLabels,
  ApexPlotOptions,
  ApexResponsive,
  ApexXAxis,
  ApexLegend,
  ApexFill,
  ApexGrid, ChartComponent, ApexStroke, ApexTitleSubtitle, NgApexchartsModule, ApexMarkers
} from 'ng-apexcharts';

export type ChartOptions = {
  series: ApexAxisChartSeries;
  chart: ApexChart;
  dataLabels: ApexDataLabels;
  plotOptions: ApexPlotOptions;
  responsive: ApexResponsive[];
  xaxis: ApexXAxis;
  legend: ApexLegend;
  fill: ApexFill;
  grid: ApexGrid;
  stroke: ApexStroke;
  markers: ApexMarkers;
  tooltip: ApexTooltip;
};

@Component({
  selector: 'electron-gov-rating',
  standalone: true,
  imports: [
    NgApexchartsModule
  ],
  templateUrl: './electron-gov-rating.component.html',
  styleUrl: './electron-gov-rating.component.scss'
})

export class ElectronGovRatingComponent {
  @ViewChild('chart') chart: ChartComponent;
  public chartOptions: Partial<ChartOptions>;

  constructor() {
    this.chartOptions = {
      series: [ {
        name: 'O\'rin',
        data: [ 10, 41, 35, 51, 49, 62, 69, 91, 148 ]
      } ],
      chart: {
        height: 350,
        type: 'area',
        zoom: {
          enabled: false
        },
        toolbar: {
          show: false
        }
      },
      dataLabels: {
        enabled: false
      },
      stroke: {
        curve: 'straight',
        width: 3,
        colors: [ '#9E77ED' ]
      },
      grid: {
        strokeDashArray: 4
      },
      fill: {
        gradient: {
          shade: 'dark',
          type: "vertical",
          shadeIntensity: 0.5,
          gradientToColors: ['#ddc8f8'], // optional, if not defined - uses the shades of same color in series
          inverseColors: true,
          opacityFrom: 0.8,
          opacityTo: 0.1,
          stops: [0, 90, 100],
          colorStops: []
        }
      },
      markers: {
        colors: ['#9E77ED'],
        size: 6,  // Adjust marker size as desired
        hover: {
          sizeOffset: 0  // Set hover size offset to 0 to disable hover effect
        }
      },
      xaxis: {
        categories: [ 10, 41, 35, 51, 49, 62, 69, 91, 148 ]
      },
      tooltip: {
        marker: {
          show: false
        }
      }
    };

    let chart = new ApexCharts(document.querySelector('#chart'), this.chartOptions);
    chart.render();
  }
}
